import React, {useEffect, useState} from 'react';
import './editForm.css';
import FormForAddAndEditProduct from '../formForAddOrEditProduct/Form';



const EditForm = () => {
    const [productToEdit, setProduct] = useState([])
    useEffect(() => {
        fetch('http://localhost:3000/products/:getById')
            .then(res => {
                if(res.ok) {
                    return res.json()
                }
            }).then(jsonRes => setProduct(jsonRes))
    })
    console.log(productToEdit)
    return (
        <div className="editForm">
            <FormForAddAndEditProduct />
            <button 
                type="reset" 
                className="resetFormButton"
            >
                RESET
            </button>
            <button 
                type="cancel" 
                className="cancelChangesButton"
            >
                CANCEL
            </button>
        </div>
    )
}

export default EditForm;
